import axios from 'axios'

export const asyncGetUser = () => {
    return (dispatch) => {
        axios.get('http://localhost:3088/api/user')
            .then((response) => {
                console.log(response)
            })
            .catch((err) => {
                console.log(err)
            })
    }
}
